var quList={init:function(){quList.getPlanListInfo();$('.class-tbody').off('click').on('click','.question1',function(){var pkId=$(this).parent().parent().find('.pk-id').val();location.href="approvalDetails.html?pkId="+pkId});$('.class-tbody ').on('click','.question2',function(){var pkId=$(this).parent().parent().find('.pk-id').val();location.href="nonSelection.html?pkId="+pkId})},getPlanListInfo:function(){$yt_baseElement.pageLoadingShow();$yt_baseElement.pageLoadingHide();$.ajax({url:$yt_option.base_path+"questionnaire/lookForAll",type:"post",data:{},objName:'data',success:function(data){if(data.flag==0){var htmlTbody=$('.class-tbody');var htmlTr='';if(data.data.length>0){$.each(data.data,function(i,v){htmlTr+='<tr><input type="hidden" class="pk-id" value="'+v.pkId+'"><td><a class="yt-link question'+v.types+'">'+v.templateName+'</a></td><td>'+v.updateUserName+'</td><td>'+v.updateTime+'</td></tr>'})}else{htmlTr+='<tr style="border:0px;background-color:#fff !important;" ><td colspan="3" align="center" style="border:0px;"><div class="no-data" style="width: 280px;margin: 0 auto;"><img src="../../resources/images/common/no-data.png" alt="" style="padding: 35px 0 20px;"></div></td></tr>'}$yt_baseElement.pageLoadingShow();$yt_baseElement.pageLoadingHide();htmlTbody.html(htmlTr)}else{$yt_alert_Model.prompt("查询失败")}},isSelPageNum:true })}};$(function(){quList.init()});